class Solution:    def reverseWords(self, s):        """        Do not return anything, modify s in-place instead.        """        words, temp = [], []        for item in s:            if item == " ":                words.append(temp)                temp = []            else:                temp.append(item)        if len(temp): words.append(temp)        start = 0        for word in words[::-1]:            s[start:start+len(word)] = word            if start+len(word)<len(s):                s[start+len(word)] = " "            start += len(word) + 1        return